Method.Source:
    [Form]
    public class CustomsBillOfEntryJournal_IN extends FormRun
    {
        InventDimCtrl_Frm_Mov   inventDimFormSetup;
        FormDataSource          purchTable_ds;
        boolean                 isCancelled;
        #ISOCountryRegionCodes
}

/// <summary>
/// Form close event handler.
/// </summary>
public void close()
{
    super();
    if (isCancelled)
        element.refreshCaller();
}

public void enableEximFields()
{
    boolean showEximIncentiveScheme = TaxParameters::find().EximIncentiveSchemes_IN;
    boolean isCustomsEnabled = TaxParameters::isCustomsEnable_IN();

    eximVendBOETrans_EximIncentiveSchemeGroup.visible(showEximIncentiveScheme);
    eximVendBOETrans_EximPorts.visible(isCustomsEnabled);
    eximVendBOETrans_EximProductGroupTable.visible(isCustomsEnabled);
    eximVendBOETrans_AssessableValue.visible(isCustomsEnabled);
}

void init()
{
    #winApi;

    isCancelled = false;

    super();

    switch (element.args().dataset())
    {
        case tablenum(PurchTable):
            purchTable_ds = FormDataUtil::getFormDataSource(element.args().record());
            break;
        default:
            break;
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
    element.enableEximFields();

    // <GTE>
    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxDocumentLauncher.visible(true);
    }
    // </GTE>

    if (TaxIntegrationUtils::isChargeOnBOEEnabled())
    {
        ViewChargeHeader.visible(true);
        ViewChargeLine.visible(true);
    }
}

/// <summary>
/// Refresh caller form.
/// </summary>
public void refreshCaller()
{
    Object myCaller = element.args().caller();

    if (myCaller && myCaller is FormRun)
    {
        if (myCaller.name() == formStr(PurchTable))
        {
            myCaller.formBOEJournalClosed_IN();
        }
        else if (purchTable_ds)
        {
            purchTable_ds.research(true);
        }
    }
}

/// <summary>
/// Tweak cancel buttons group status
/// </summary>
public void tweakCancelButton()
{
    boolean isEnable = false;
    if (CustomsBOEJour_IN && CustomsBOEJournalFacade_IN::checkJournalForCancel(CustomsBOEJour_IN))
    {
        isEnable = true;
    }
    CancelButton.enabled(isEnable);
}

/// <summary>
/// Tweak line buttons group status
/// </summary>
public void tweakLineButtons()
{
    boolean isEnable = true;

    if (CustomsBOEJour_IN && CustomsBOEJour_IN.Status == CustomsVendBOEStatus_IN::Canceled)
    {
        isEnable = false;
    }
    LinesButtonGroup.enabled(isEnable);
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    PurchLine   purchLine;
    InventMovement movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);

        case InventDimFormDesignUpdate::Active      :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strfmt("@SYS54195",funcname()));
    }
}

/// <summary>
/// Active event handler.
/// </summary>
/// <returns>
/// Status flag
/// </returns>
public int active()
{
    int ret;

    ret = super();
    element.tweakCancelButton();
    element.tweakLineButtons();

    return ret;
}

public int active()
{
    int ret;

    ret = super();
    element.updateDesign(InventDimFormDesignUpdate::Active); // For the Dimensions display button

    return ret;
}

public void init()
{
    QueryBuildDataSource qbD;
    ;

    super();
    qbD = this.query().dataSourceName(this.name());
    qbD.addLink(fieldnum(CustomsVendBOETrans_IN, RecId), fieldnum(CustomsVendBOETrans_IN, RecId));
}

/// <summary>
/// Cancel BOE Journal button click handler
/// </summary>
void clicked()
{
    if ( !Box::confirm("@SYS4082032","@SYS4082033") )
        return;

    super();

    if (CustomsBOEJour_IN.RecId)
    {
        if (CustomsBOEJournalFacade_IN::cancelJournal(CustomsBOEJour_IN.RecId))
        {
            CustomsBOEJour_IN_DS.reread();
            CustomsBOEJour_IN_DS.refresh();
            CustomsBOEJour_IN_DS.active();
            isCancelled = true;
        }
    }
}
